import Head from 'next/head';
import SearchMovies from '../components/SearchMovies';
import { MovieProvider } from '../components/MovieContext';

export default function Home() {
	return (
		<MovieProvider>
			<div>
				<Head>
					<title>Next App</title>
				</Head>
				<p>Hello Nextjs</p>
				<SearchMovies />
			</div>
		</MovieProvider>
	);
}
